Promotional info - &quot;The sexy, madcap super-villain duo of Harley Quinn and Poison Ivy plan to take down Batman once and for all in this uproariously funny volume. But first, Harley has to convince Ivy that she has what it takes to be a villain in Gotham City! 
This volume features a fantastic 3-chapter story written by Paul Dini and illustrated by Bruce Timm, the award-winning producers of Batman: The Animated Series, plus a story by superstars talents Judd Winick and Joe Chiodo.&quot;

This is a fun and funny series with art in the B:TAS style and some great characterization of the two main characters. 

These are the new digital copies by Son of Ultron-Empire. Thanks to them for their efforts; please seed and enjoy. 

